import React from "react";
import { Container, Row, Col } from 'react-bootstrap';
import style from './Button.module.scss';

class Button extends React.Component {
  render() {
    return (
      <Container>
        <p className={ style.title }>Hoi</p>
      </Container>
    )
  }
}

export default Button;
